import './App.css';
import Form from './components/Form/Form';
import Image from './components/Image/Image';
import { Component } from 'react';
// import React from 'react';

class App extends Component {

  constructor(props) {
    super(props);
    this.state = {
      memes: undefined
    }
  }

  componentDidMount() {
    this.getMemes();
  }
  getMemes = async () => {
    const apiCall = await fetch('http://localhost:2000/memes');
    const data = await apiCall.json();

    this.setState({
      memes: this.data
    });
    console.log(this.memes);
  }

  render() {
    return (
      <div className="">
          <Form />
          {/* <div>{this.getMemes()} </div> */}
          <Image />
      </div> 
    );
  }
}


export default App;
